import React, { useState } from 'react';
import './App.css';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import { Home } from './components/Other/Home';
import { Navbar } from './components/Other/Navbar';
import { Supplements } from './components/Menu/Supplements';
import { Machines } from './components/Menu/Machines';
import { Additional } from './components/Menu/Additional';
import { Cart } from './components/Other/Cart';
import { Login } from './components/Auth/Login';
import { Register } from './components/Auth/Register';
import supplementsData from './datas/supplements.json';
import machinesData from './datas/machines.json';
import additionalData from './datas/additional.json';

function App() {
  const [supplements, setSupplements] = useState(supplementsData.supplements);
  const [machines, setMachines] = useState(machinesData.machines);

  return (
    <>
    <Router>
    <div>
        <h1>FitJim</h1>
        <Navbar />
          <Routes>
            <Route path='/' element={<Home />} />
            <Route path='/Supplements' element={<Supplements supplements={supplements} setSupplements={setSupplements}/>} />
            <Route path='/Machines' element={<Machines machines={machines} setMachines={setMachines}/>} />
            <Route path='/Additional' element={<Additional />} />
            <Route path='/Cart' element={<Cart />} />
            <Route path='/Login' element={<Login />} />
            <Route path='/Register' element={<Register />} />
          </Routes>
    </div>
    </Router>
    </>
  );
}

export default App;
